values:
&nbsp;And now I'm fascinated with her....I guess I feel like she's my only sort of lifeline to you.... 

IMAG0023.&nbsp; Dead babies and A1 sauce.&nbsp;&nbsp;

And yes, despite what everyone else may or may not have thought about you, I planned on marrying you.&nbsp;


I hate you.

&nbsp;Those times when i say innapropriate things, that you coming out through me.&nbsp; I love myself and I hate myself for it.&nbsp;&nbsp;


Yeah, I sent it.&nbsp; Sometimes I get an itch that i can't help but scratch.&nbsp;&nbsp;
People who used to talk about you like they were gunning for us....things they said afterward really hurt.


I'm all out.&nbsp;
Later.

I hate living here.

I don't even feel like I should be paying the $200 a month that I do to 'live' here.&nbsp; I mean, I sleep here 3 night a week at most.&nbsp; and I don't do much more here than that. I pretty much use this place as a storage unit.....

Why don't I get a real storage unit, then? I'm sure it would be less than 200 dollars a month.&nbsp;

I know I haven't updated in a while.... there just hasn't really been anything to update on.&nbsp; 

Lately, if i'm not at Matt's house,&nbsp; I'm at work.&nbsp; And today I'm working at 12 instead of 1.&nbsp; Til 8.&nbsp; Melissa asked if i wanted to come in early to help out more.&nbsp; Apparently Company is gonna be there.

My room is still a mess.&nbsp; 

I haven't really had that much time off work without having something planned ahead of time.&nbsp; We a had a Bloom meeting two weeks ago, and then the following week I had to go to store 391 on Shore Drive and grea Neck Road. I had to go there so that those workers could go to their own Bloom meeting.&nbsp; And then on Saturday, my mom, Matt, and I all went to Busch Gardens.&nbsp; Matt got a fun card, so as long as he's with me, he can get in without parking.

.....and all of the sudden it was time for me get ready to go to work.&nbsp; I don't think I'll be staying at Matt's tonight, so Maybe I can post more later.
